function App() {
  return (
    <div>
      <div className="Header">
        <Navbar/>
        <Heading />
      </div>
      <div>
        <Skills />
      </div>
      <div>
        <Projects />
      </div>
      <div>
        <Footer />
      </div>
    </div>
  );
}

export default App;
